records.addlTxt:
State files an Amended Information charging 1 ct. obstruct officer, contrary to Section 946.41(1) of the Wisconsin Statutes and 1 ct. deliver controlled substance, fentanyl, contrary to Section 961.41(3g)(b) of the Wisconsin Statutes.   
No contest pleas to the amended charges.   Convicted.   Sentences are withheld.   Deendant is placed on probation to DOC for two (2) years.   Conditions of probation are:
1) AODA assessment and follow through; 
2) Assessment/treatment/counseling as deemed appropriate by the Department's assessment process; 
3) Maintain full-time employment/schooling combination; 
4) Obtain GED/HSED;
5) Maintain absolute sobriety except for prescribed drugs in prescribed doses; 
6) Submit DNA sample and pay surcharge; 
7) Pay costs of action; 
8) Pay supervision fees in an amount to be determined by DOC; 
9) On Count 1, Thirty (30) days jail imposed and stayed, to be imposed upon the agent's discretion.   
Minutes.
